import React from 'react';
import './master.css';

function Banner() {

    return (
        <div className="banner-container">
        <a href="/">
  <div className="image-overlay">
    <img className="logo" src="../images/izzy-logo.png" alt="Izzy Logo"/>
    <img className="overlay-logo" src="../images/overlay-logo.png" alt="Overlay Logo"/>
  </div>
</a>
        <div className="banner-header-text">
            <h1>Hi, my name is Izzy. I study engineering at Northestern. In my free time, I love playing music and exploring natural wonders with my camera!</h1>
        </div>
        </div>
    )
}

export default Banner;
